import React, { Component } from "react";
import Tab from "../Tab/Tab";
import "./Tabs.css";

export default class Tabs extends Component {
  render() {
    var allTabs = [];
    var i;
    for (i = 1; i < 5; i++) {
      allTabs.push(<Tab key={i} index={i} />);
    }

    return <div className="tabs">{allTabs}</div>;
  }
}
